import React from 'react'

const Message = ({messages,user_id}) => {
    console.log(messages)
    return (
        <div>
            <p>{JSON.stringify(messages,null,'\t')}</p>
            {messages.map(message=>{
                <>
                <p>{message.name}</p>
                <p>{message.text}</p>
                </>
            })}
        </div>
    )
}

export default Message
